description:
A series of bad choices, a less than desirable home life and a recent brush with the law have 19 year-old Riley desperate for a way out. With dreams of a better life, she heads to Hollywood where she comes to realize that the grass is not always greener. Disillusioned, she packs her bag and takes off once again. Will Riley find out what she is looking for or will she be just another statistic? 

